sparql:
SELECT ?war ?start_time ?end_time ((?end_time - ?start_time) / (60*60*24)) AS ?duration_in_days WHERE {
  ?war wdt:P31 wd:Q198;
       wdt:P580 ?start_time;
       wdt:P582 ?end_time.
  BIND(((xsd:dateTime(?end_time) - xsd:dateTime(?start_time)) / xsd:decimal(86400)) AS ?duration_in_days)
}
ORDER BY ?duration_in_days ?start_time
LIMIT 15
